.rsslider {
  width: 400px;
  height: 300px;
  border: 1px solid black;
  position: relative;
  overflow: hidden; }
  .rsslider__wrapper {
    width: 100%;
    height: 100%; }
  .rsslider__item {
    z-index: 10;
    transition: opacity linear .3s; }
    .rsslider__item.scrollable {
      overflow-y: scroll; }
    .rsslider__item > div {
      padding: 1em 3em;
      background-color: #eee;
      min-height: 100%; }
    .rsslider__item > img {
      width: 100%;
      height: 100%;
      position: absolute;
      top: 0;
      left: 50%;
      margin-left: -50%; }
    .rsslider__item.hidden {
      opacity: 0; }
  .rsslider__prev, .rsslider__next {
    width: 50px;
    height: 100px;
    position: absolute;
    top: 50%;
    margin-top: -50px;
    cursor: hand;
    z-index: 20;
    background-color: transparent;
    border: 0;
    background-position: 50% 50%;
    background-repeat: no-repeat;
    background-size: 50%;
    transition: visibility linear .3s; }
    .rsslider__prev.hidden, .rsslider__next.hidden {
      visibility: hidden; }
  .rsslider__prev {
    left: 0;
    background-image: url("prev.3e8cadf3.png"); }
  .rsslider__next {
    right: 0;
    background-image: url("next.8d3db09f.png"); }
  .rsslider__paginator {
    position: absolute;
    bottom: 10px;
    text-align: center;
    width: 100%; }
    .rsslider__paginator__button {
      width: 8px;
      height: 8px;
      border-radius: 4px;
      margin: 3px;
      padding: 0;
      border: 0;
      background-color: #fff;
      box-shadow: 1px 1px 5px black;
      cursor: hand; }
      .rsslider__paginator__button:hover {
        background-color: red;
        opacity: 1; }
      .rsslider__paginator__button.active {
        background-color: darkred;
        cursor: pointer; }
